import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <h2>Home Page</h2>
        <p>Welcome to GameHub!</p>

        <p>Created by Jon Kelly and Tyler Krueger.</p>
      </div>
    );
  }
}

export default Home;
